*/

const router = createBrowserRouter([
  {
    path: '/',
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      {
        path: '/',
        element: <HomePage />
      }, {
        path: '/products',
        element: <Products />
      },
      {
        path: '/products/:id',
        element: <ProductDetail />
      }
    ]
  },
]);




const App = () => {
  return <RouterProvider router={router} />
};

export default App;
